import React, {Component} from 'react';

class App extends Component {
  render(){
    return (
      <div>
        <main className="container">
          <h1>Todo List</h1>
          <ol>
            <li className="breadcrumb-item active"> Code</li>
            <li className="breadcrumb-item active"> Eat</li>
            <li className="breadcrumb-item active"> Sleep</li>
          </ol>
        </main>
      </div>
    );
  }
}

export default App;
